import React from "react";
import style from "./Recommended.module.css";
import {
  Button,
  Accordion,
  Card,
  AccordionToggle,
  AccordionCollapse
} from "react-bootstrap";
import HeaderBody from "../../components/HeaderBody/HeaderBody";
import { NavLink } from "react-router-dom";

function Recommended() {
  return (
    <div className={style.body}>
      <div className={style.container}>
        <HeaderBody />
        <div className={style.user}>
          <Accordion >
            <Card className={style.card}>
              <Card.Header >
                <AccordionToggle  as={Card.Header} eventKey="0">
                  <div className={style.location}>
                    <li>Obelisk</li>
                    <span className={style.new}>New</span>
                  </div>
                </AccordionToggle>
              </Card.Header>
              <AccordionCollapse eventKey="0">
                <Card.Body>Hello ! I'm David</Card.Body>
              </AccordionCollapse>
            </Card>
          </Accordion>

      
        </div>
      </div>
    </div>
  );
}

export default Recommended;
